import React, { useState } from 'react';
import styled from 'styled-components';
import { colors } from '../../styles';
import Title from '../Title';
import InfoBoxWithMenu from './InfoBoxWithMenu';

const Box = styled.div`
  background-color: ${colors().navy2};
  min-height: 300px;

  > div h3 {
    text-align: center;
    padding: 40px 0;
  }
`;

function Coworking() {
  const [state] = useState([
    { id: 1, name: 'eco masuria', text: 'eco masuria bla bla' },
    { id: 2, name: 'sun vibes', text: 'sun vibes bla bla bla' },
    { id: 3, name: 'urocze wzgórze', text: 'urocze wzgórze bla bla bla' },
  ]);
  const [active, setActive] = useState(1);

  const handleClick = (e) => {
    setActive(parseInt(e.target.dataset.id));
  };
  return (
    <Box>
      <Title
        size={42}
        color={colors(0.5).navy3}
        text="WSPÓŁPRACA"
        weight={700}
      />
      <InfoBoxWithMenu
        data={state}
        handleClick={handleClick}
        text={state.text}
      />
    </Box>
  );
}

export default Coworking;
